atment',1,NULL,123,'Spray of insecticide,its quantity and method is shown\r\n','','','',NULL,NULL,'','2009-09-02','2009-09-02',1,'','','','',71,63,59,NULL,NULL,NULL,1,'','I','2010-02-01 22:52:52'),(25,'Brinjal Insecticidal Treatment',1,NULL,125,'Spray of insecticide,its quantity and method is shown\r\n','','','',NULL,NULL,'','2009-09-02','2009-09-02',1,'','','','',71,59,63,NULL,NULL,NULL,1,'','I','2010-02-01 23:36:26'),(26,'Tomato Sowing',1,NULL,123,'Sowing of tomato from nursery bed,its method,and application of fertilizer is shown.\r\n','','','',NULL,NULL,'','2009-09-03','2009-09-03',1,'','','','',72,63,59,NULL,NULL,NULL,1,'','I','2010-02-01 23:59:39'),(27,'Radish Nursery Bed',1,NULL,125,'Nursery bed preperation of radish with amout of fertilizer required and metod of bed preperation is shown.\r\n','','','',NULL,NULL,'','2009-09-03','2009-09-03',1,'','','','',73,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:07:30'),(28,'Pumpkin earthing up',1,NULL,123,'Earthing up operation in pumpkin and its fertilizer application.\r\n','','','',NULL,NULL,'','2009-09-12','2009-09-12',1,'','','','',74,58,78,NULL,NULL,NULL,1,'','I','2010-02-02 00:24:42'),(29,'Insecticidal Treatment in Paddy',1,NULL,125,'Treatment of insecticide,its quantity,and method of application is shown.\r\n','','','',NULL,NULL,'','2009-09-13','2009-09-13',1,'','','','',70,78,58,NULL,NULL,NULL,1,'','I','2010-02-02 00:30:10'),(30,'20 days duck feed and treatment',1,NULL,125,'Feeding and treatment of 20 days old duck is shown.Precaution to be taken is also shown\r\n','','','',NULL,NULL,'','2009-09-13','2009-09-13',1,'','','','',62,59,63,NULL,NULL,NULL,1,'','I','2010-02-02 00:32:52'),(31,'20 days duck feed and treatment',1,NULL,123,'Feeding and treatment of 20 days old duck is shown.Precaution to be taken is also shown\r\n','','','',NULL,NULL,'','2009-09-13','2009-09-13',1,'','','','',62,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 00:34:49'),(32,'Feeding of fish',1,NULL,125,'It deals with feeding of fish,its method,