',52,63,59,NULL,NULL,NULL,1,'','I','2010-02-02 01:41:23'),(48,'Cauliflower earthing up',1,NULL,125,'','','','',NULL,NULL,'','2009-09-10','2009-09-10',1,'','','','',71,59,63,NULL,NULL,NULL,1,'','I','2010-02-04 04:31:05'),(50,'Transplantation of Onion Seedling',1,NULL,125,'This video is kind of demonstration showing method of uprooting of Onion seedling from nursery bed and transplantation in main field.','','','',NULL,NULL,'','2010-01-10','2010-02-04',1,'','','','',94,84,81,NULL,NULL,NULL,1,'','I','2010-02-06 00:24:06'),(51,'A. I Programme',1,NULL,127,'The process of NDDB program was takenup & also it tells that BAIF was established A.I centers and doing better compare with department\r\n','','','',NULL,NULL,'','2009-06-12','2009-06-12',1,'','','','',95,87,86,NULL,NULL,NULL,1,'','I','2010-02-08 03:43:10'),(52,'Low cost cattle feed',1,NULL,127,'Here the farm women was preparing low costcattle feed by use of locally available grains of both cereals and pulses and mixing with subabul dry leaves and jaggery.  Salt and mineral mixture which reduces the 40 % cost and increasing the nutritive value\r\n','','','',NULL,NULL,'','2009-06-20','2009-06-20',1,'','','','',44,87,92,NULL,NULL,NULL,1,'','I','2010-02-08 03:45:55'),(53,'Ring Trench Biomas',1,NULL,127,'It is a new technique of making trench arround 2 years old mango tree and putting dry leaves, vermi compost and dung slurry  and finally covered with top soil which increases the water holding capacity and nutrient quality of soil\r\n','','','',NULL,NULL,'','2009-06-22','2009-06-22',1,'','','','',44,94,92,NULL,NULL,NULL,1,'','I','2010-02-08 03:48:11'),(54,'Azolla',1,NULL,127,'Here the farmer producing Azolla & using as a cattle feed by mixing with flour\r\n','','','',NULL,NULL,'','2009-07-07','2009-07-07',1,'','','','',48,53,86,NULL,NULL,NULL,1,'','I','2010-02-08 03:55:29'),(55,'WADI',1,NULL,127,'It is a program taken up by BAIF by establishing mango orchards & planting forestry saplings around the plant with inter cultivation of agriculture crops by making farm pond in the corner for water source\r\n','','','',NULL,NULL,'','2009-07-18','2009-07-18',1,'','','','',46,95,86,NULL,NULL,NULL,1,'','I','2010-02-08 03:58:48'),(56,'Low cost Vermicompost',1,NULL,127,'It was demonstrated for the preparation of low cost vermicompost without use of cement structures.\r\n','','','',NULL,NULL,'','2009-08-13','2009-08-13',1,'','','','',44,85,92,NULL,NULL,NULL,1,'','I','2010-02-08 03:59:44'),(57,'Bio gas',1,NULL,127,'','','','',NULL,NULL,'','2009-09-08','2009-09-08',2,'','','','',44,93,92,NULL,NULL,NULL,1,'','I','2010-02-08 03:13:46'),(58,'Jeevamruta',1,NULL,127,'Jeevamruta video is meant its advantage of increasing microbial activity in the soil. It is one of the practices of organic farmer.It is low cost technique and most of the farmers can adopt it .\r\n','','','',NULL,NULL,'','2009-09-17','2009-09-17',1,'','','','',48,53,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:14:46'),(59,'Baby nutrition food',5,NULL,127,'This ia a demonstration of preparation of highly nutritive baby food.It comprises of cereals and pulses. This is preferably most used by below 1 year old.\r\n','','','',NULL,NULL,'','2009-09-17','2009-09-17',2,'','','','',48,53,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:16:03'),(60,'Mound soil soap',1,NULL,127,'This is a demonstration of preparation of soap using mound soil of some herbs. This can be used against several skin diseases.\r\n','','','',NULL,NULL,'','2009-09-18','2009-09-18',2,'','','','',48,53,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:17:26'),(61,'Paddy raised seed bed',1,NULL,127,'It is a demonstration of making raised bed for paddy nursery raising.  This can be adopted for SRI method of paddy cultivation\r\n','','','',NULL,NULL,'','2009-10-01','2009-10-01',1,'','','','',45,50,85,NULL,NULL,NULL,1,'','I','2010-02-08 02:55:01'),(62,'Dry fodder preservation',1,NULL,127,'It is a method of preserving the different dry fodders keeping layer by layer and making as a \"heap banave\" which improves the palatable and nutritive value.  It is mainly used in summer seaon. \r\n','','','',NULL,NULL,'','2009-10-08','2009-10-08',1,'','','','',45,91,50,NULL,NULL,NULL,1,'','I','2010-02-08 02:57:23'),(63,'Paddy seed treatment',1,NULL,127,'This demonstration was conducted in FFS group.  Here the seed treatment is mainly for removing the chappy materials of using local paddy seeds\r\n','','','',NULL,NULL,'','2009-10-12','2009-10-12',1,'','','','',45,50,52,NULL,NULL,NULL,1,'','I','2010-02-08 02:59:39'),(64,'Biopesticide',1,NULL,127,'It was deomonstrats that preparation of Biopesticide by using 6 different plant leaves and garlic. These are soaked about 30 days in a cattle urine then extract the solution and sprayed for any crop for pest and disease control\r\n','','','',NULL,NULL,'','2009-10-13','2009-10-13',1,'','','','',48,53,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:02:04'),(65,'Organic urea',1,NULL,127,'Here the farmer was preparing organic urea by use of sand and cattle urine as a low cost technique\r\n','','','',NULL,NULL,'','2009-10-14','2009-10-14',1,'','','','',50,55,52,NULL,NULL,NULL,1,'','I','2010-02-08 03:03:40'),(66,'Mulching ',1,NULL,127,'Here the farmer was using dry materials of banana for mulching in banana garden which increases the retention capacity of water in soil and controls weed growth and improvesfertility and productivity of soil\r\n','','','',NULL,NULL,'','2009-10-15','2009-10-15',1,'','','','',101,55,51,NULL,NULL,NULL,1,'','I','2010-02-08 03:05:34'),(67,'Adusoge khasahaya',1,NULL,127,'Herbal solution for controlling chough and fever, very good medicine for children. This can be prepared by for chiddren.This can be prepared by using leaves of adusoge which can be easily available everywhere and can be grown everywhere.\r\n','','','',NULL,NULL,'','2009-09-18','2009-09-19',1,'','','','',48,53,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:20:18'),(68,'Amruta balli',1,NULL,127,'This is a dissemination of preparation of khashaya using a herb named amrutaballi.This khashaya is useful in preventing fevers an dalso helpful in preventing some common diseases like BP, sugar etc.As this amrutaballi is available in everyplace, the people are unaware of it. This video helps in identifying this creeps and can make .\r\n','','','',NULL,NULL,'','2009-09-19','2009-09-19',1,'','','','',48,53,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:22:26'),(69,'Fodder development',1,NULL,127,'Video demostrates about famer established fodder as a intercrop with mango trees.Using 3 improved fodder varieites and harvesting 8 times in ayear.Because of fodder which improves soil and water conservation.\r\n','','','',NULL,NULL,'','2009-09-21','2009-09-21',1,'','','','',47,50,52,NULL,NULL,NULL,1,'','I','2010-02-08 03:24:28'),(70,'Flori culture ',2,NULL,127,'Its all about farmer cultivating jasmine in his area and getting more income  compared to other commercial crops.In turn providing labour to poor people and can harvest the crop through out the year.\r\n','','','',NULL,NULL,'','2009-09-22','2009-09-22',1,'','','','',45,50,52,NULL,NULL,NULL,1,'','I','2010-02-08 03:27:25'),(71,'Forest tree pruning',1,NULL,127,'the video demonstrates the Mangement of the trees so that it should shade main crops.It provides fuel wood, green manures and fodder and also acts as wind break.\r\n','','','',NULL,NULL,'','2009-09-23','2009-09-23',1,'','','','',44,92,85,NULL,NULL,NULL,1,'','I','2010-02-08 03:29:28'),(72,'Dung slurry application',1,NULL,127,'This video demonstrates the application of dung slurry on one year old plants. This helps in control grazing, plant growth acting as hormone.\r\n','','','',NULL,NULL,'','2009-09-24','2009-09-24',1,'','','','',46,50,50,NULL,NULL,NULL,1,'','I','2010-02-08 03:31:12'),(73,'Mango planting technique',1,NULL,127,'Demonstration of how to plant mango sappling by digging pit and filling the materials at the time of planting.\r\n','','','',NULL,NULL,'','2009-09-24','2009-09-24',1,'','','','',47,51,51,NULL,NULL,NULL,1,'','I','2010-02-08 03:32:53'),(74,'Mango tree pruning',1,NULL,127,'Farmer pruning branches which have seriously attached by pest and diseases.\r\n','','','',NULL,NULL,'','2009-09-25','2009-09-25',1,'','','','',43,87,49,NULL,NULL,NULL,1,'','I','2010-02-08 03:34:54'),(75,'Jowar seed treatment ',1,NULL,127,'The video demonstrates the seed treatment of Jowar seeds before sowing.  It controls the seed born diseases like smut, sootymould and for uniform and higher germination percentage. By this treatment the jowar yield also increases.\r\n','','','',NULL,NULL,'','2009-09-25','2009-09-25',1,'','','','',43,87,85,NULL,NULL,NULL,1,'','I','2010-02-08 03:38:06'),(76,'Potato Pest & Disease management_kamara_sadari',1,NULL,4,'Fungicide application in Potato cultivation. Mainly this application prevents fungal diseases like blight. This can be screen in Rabi season','','','',NULL,NULL,'','2009-12-20','2009-12-20',1,'','','','',104,96,34,NULL,NULL,NULL,1,'','I','2010-02-08 05:00:02'),(77,'Cabbage Pest & Disease Management_T.Navatoli_Sadari',1,NULL,4,'It shows the method of application of pesticide and/or fungicide to control pests & diseases of cabbage. It even covers the farmer\'s past experience & success story of cabbage cultivation. ','','','',NULL,NULL,'','2010-01-22','2010-01-25',1,'','','','',96,33,34,NULL,NULL,NULL,1,'','I','2010-02-08 22:20:54'),(78,'Cauliflower Pest & Disease Management_T.Navatoli_Sadari',1,NULL,4,'It shows the method of application of pesticide and/or fungicide to control pests & diseases of cauliflower. ','','','',NULL,NULL,'','2010-01-23','2010-01-25',1,'','','','',96,33,34,NULL,NULL,NULL,1,'','I','2010-02-08 23:36:45'),(79,'Paddy yield comparisison between SRI and traditional method',1,NULL,123,'This video is kind of demonstration for comparing the paddy yield between  SRI and Traditional method of cultivation','','','',NULL,NULL,'','2010-01-05','2010-02-10',1,'','','','',91,84,81,NULL,NULL,NULL,1,'','I','2010-02-09 00:59:57'),(80,'Cabbage harvesting',4,N