ows the fertlizers (Mixture of chemical fertilizer and cow dung ) application in prepared bed beforoe sowing of seed. It shows the application of water by using sprinkler after sowing of seed.','','','',NULL,NULL,'','2009-10-23','2009-10-30',1,'','','','',105,83,82,NULL,NULL,NULL,1,'','I','2010-02-09 02:05:26'),(87,'Pest control in Cabbage',1,NULL,125,'This is kind of demonstration showing the  application of pesticides in cabbage field. It shows the pesticides used, preparation of solution and application in field.','','','',NULL,NULL,'','2009-11-15','2009-12-18',1,'','','','',94,84,81,NULL,NULL,NULL,1,'','I','2010-02-09 02:21:04'),(88,'Preparation of Handi kath',1,NULL,123,'This is a kind of demonstration sowing the method of preparation of Jeevamrita which is also known as Handi Kath. This video also shows the ingradients used for preparation.','','','',NULL,NULL,'','2009-11-15','2009-12-18',1,'','','','',107,83,82,NULL,NULL,NULL,1,'','I','2010-02-09 02:35:04'),(89,'Preperation of compost from weeds (Grass)',1,NULL,123,'This is a kind of demonstration sowing how to preparare compost by using Sawai Grass.This compost is used as organic fertilizer in various filed crop like paddy and also in vegetables. It is used mainly as soil application during filed preparation.','','','',NULL,NULL,'','2009-11-15','2009-12-18',1,'','','','',106,83,82,NULL,NULL,NULL,1,'','I','2010-02-09 02:42:56'),(90,'Seedbed preparation and sowing of onion seed',1,NULL,125,'This is a kind of demonstration sowing the operation involved in seedbed preparation, fertilizer applied and the sowing of seed.','','','',NULL,NULL,'','2009-10-23','2009-11-22',1,'','','','',94,84,81,NULL,NULL,NULL,1,'','I','2010-02-09 02:47:16'),(91,'Nursery bed preparation for tomato and seed sowing ',1,NULL,123,'This is kind of demonstration showing the  preparation of nursery  bed and sowing of tomato seed. It also shows the application of fertilizer in seed bed before sowing.','','','',NULL,NULL,'','2009-10-23','2009-11-22',1,'','','','',93,83,82,NULL,NULL,NULL,1,'','I','2010-02-09 02:53:09'),(92,'Summer Paddy Seed Treatment_Jibilong_mundari',1,NULL,3,'Seed treatment of paddy which describes the method of seed treatment and importance of it.','','','',NULL,NULL,'','2010-01-24','2010-01-24',1,'','','','',25,97,34,NULL,NULL,NULL,1,'','I','2010-02-09 08:36:31'),(93,'Mango orchard Activities 1_Gufu_sadari',1,NULL,4,'','','','',NULL,NULL,'','2010-01-26','2010-01-26',1,'','','','',27,99,98,NULL,NULL,NULL,1,'','I','2010-02-09 08:43:36'),(94,'Lac culture on Ber_Alankel_Sadari',2,NULL,4,'','','','',NULL,NULL,'','2010-01-30','2010-01-30',1,'','','','',110,98,34,NULL,NULL,NULL,1,'','I','2010-02-09 08:54:28'),(95,'INRM',3,NULL,1,'This is not a DG\'s community person\'s production. Its Pradan\'s movie which had screen many times in various to bring group members to think of INRM.','','','',NULL,NULL,'','2008-12-17','2008-12-25',1,'','','','',25,34,34,NULL,NULL,NULL,1,'','F','2010-02-09 09:02:29'),(96,'Staking in Tomato',1,NULL,123,'THis video shows how staking is done in tomato and the benifits of doing so. Staking provides support to plant and mainly it cheks the distruction of tomato fruit as fruit usually distroyed or rotted out when it comes in contact of soil.','','','',NULL,NULL,'','2009-09-09','2009-09-26',1,'','','','',93,83,82,NULL,NULL,NULL,1,'','I','2010-02-15 21:56:19');
